tables.table_schema:
CREATE TABLE quantum_protocols (
    protocol_id INT PRIMARY KEY,
    protocol_name VARCHAR(255),
    key_length INT,
    encryption_method VARCHAR(50)
);

CREATE TABLE quantum_users (
    user_id INT PRIMARY KEY,
    username VARCHAR(100),
    email VARCHAR(255),
    is_authenticated BOOLEAN
);

CREATE TABLE QuantumKeys (
    id SERIAL PRIMARY KEY,
    key_name TEXT NOT NULL,
    key_value BYTEA NOT NULL
);

CREATE TABLE QuantumUsers (
    user_id SERIAL PRIMARY KEY,
    username TEXT UNIQUE NOT NULL,
    public_key BYTEA NOT NULL
);

CREATE TABLE QuantumDevices (
    device_id SERIAL PRIMARY KEY,
    device_name TEXT NOT NULL,
    device_type TEXT NOT NULL
);

CREATE TABLE QuantumConnections (
    connection_id SERIAL PRIMARY KEY,
    user_id INT REFERENCES QuantumUsers(user_id),
    device_id INT REFERENCES QuantumDevices(device_id),
    key_id INT REFERENCES QuantumKeys(id)
);

CREATE TABLE quantum_users (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    public_key BYTEA NOT NULL
);

CREATE TABLE quantum_devices (
    device_id SERIAL PRIMARY KEY,
    device_name VARCHAR(50) NOT NULL,
    device_type VARCHAR(50) NOT NULL,
    user_id INT REFERENCES quantum_users(user_id) ON DELETE CASCADE
);

CREATE TABLE quantum_protocols (
    protocol_id SERIAL PRIMARY KEY,
    protocol_name VARCHAR(50) NOT NULL,
    protocol_description TEXT
);

CREATE TABLE quantum_sessions (
    session_id SERIAL PRIMARY KEY,
    session_date TIMESTAMP NOT NULL,
    protocol_id INT REFERENCES quantum_protocols(protocol_id) ON DELETE CASCADE
);

CREATE TABLE quantum_keys (
    key_id SERIAL PRIMARY KEY,
    key_value BYTEA NOT NULL,
    session_id INT REFERENCES quantum_sessions(session_id) ON DELETE CASCADE
);
